nextBtn.addEventListener("click", function (e) {
    // console.log("Next ==>");
    // console.log(i);
    document.getElementById("name").innerText = vistas[i];
    //  console.log(vistas[i])
    if (i > 3) {
        changePage(0)
        i=0
    } else {
        changePage(i+1)
    }
    i++
})

afterBtn.addEventListener("click", function (e) {
    // console.log("<== After");
    // console.log(i);
    // i--;
    document.getElementById("name").innerText = vistas[i];
    // console.log(vistas[i])
    if (i == 0) {
        i = 4
        changePage(4)
    } else {
        // i=4
        changePage(i - 1)
    }
    i--;
})

//CARRUSEL
function changePage(i) {
    switch (i) {
        case 0: showInfo("mainInfo")
            document.getElementById("name").innerHTML = "Introducing it"
            visaTypes.innerHTML = ""
            cpf.innerHTML = ''
            refugio.innerHTML = ''
            wheretogo.innerHTML =''
            break;
        case 1: showInfo("visaTypes")
            document.getElementById("name").innerHTML = "Residence"
            mainInfo.innerHTML = ""
            cpf.innerHTML = ''
            refugio.innerHTML = ''
            wheretogo.innerHTML = ''
            btnVisa();
            btnVisa2();
            btnft1();
            btnft2();
            btnft3();
            btnft4();
            // console.log("Visa Types changePages");
            break;
        case 2: showInfo("CPF")
            document.getElementById("name").innerHTML = "CPF"
            mainInfo.innerHTML = ""
            visaTypes.innerHTML = ""
            refugio.innerHTML = ''
            wheretogo.innerHTML = ''
            btnVisa();
            btnft1();
            btnft2();
            btnft3();
            // console.log("CPF");            
            break;
        case 3: showInfo("Refugio")
            document.getElementById("name").innerHTML = "Refugio"
            mainInfo.innerHTML = ''
            visaTypes.innerHTML = ''
            cpf.innerHTML = ''
            wheretogo.innerHTML = ''
            btnVisa();
            btnVisa2();
            btnft1();
            btnft2();
            btnft3();
            btnft4();
            btnft5();
            btnft6();
            // console.log("Refugio");            
            break;
        case 4: showInfo("wheretogo")
            document.getElementById("name").innerHTML = "Where to go"
            mainInfo.innerHTML = ''
            visaTypes.innerHTML = ''
            cpf.innerHTML = ''
            refugio.innerHTML = ''
            // console.log("Wher to go");
            break;
        default: showInfo("mainInfo")
            document.getElementById("name").innerHTML = "Introducing it"
            visaTypes.innerHTML = ""
            cpf.innerHTML = ''
            refugio.innerHTML = ''
            wheretogo.innerHTML =''
            break;
    }
}


